import React from 'react';

import { Container, ChatIcon, Separator, HeaderIcon } from './styles';

import { AiOutlinePlus, AiOutlineSearch } from 'react-icons/ai'

const Nav: React.FC = () => {
  return (
    <Container>
      <HeaderIcon />
      <Separator />
      <ChatIcon>
        <AiOutlinePlus />
      </ChatIcon>
      <ChatIcon>
        <AiOutlineSearch />
      </ChatIcon>
    </Container>
  );
}

export default Nav;
